            price: "Preu: 5€ anticipada",
            ticketsLink: "https://google.com",
          }}
        />
        <SpecificShow
          details={{
            month: "Novembre",
            day: "12",
            city: "Berga",
            place: "Pavelló municipal d'esports",
            price: "Preu: 5€ anticipada",
            ticketsLink: "https://google.com",
          }}
        />
      </div>
    </div>
  );
}

export default Shows;
